Fittingly, my last Wolverine torrent for a bit (I think) is Wolverine: The End, and just like the other &quot;The End&quot; stories it focuses on the hypothetical end of Logan in one possible scenario. Promotional info - &quot;Marvel's critically acclaimed The End line continues with a look at the final days in the life of Logan - the man called Wolverine! It's the distant future, and a series of strange events sends the aging Wolverine on a globe-spanning quest to find the final truths behind his origin. But when he encounters a mysterious figure from his past, everything he thought he knew is turned upside-down! It's the end of a legend, written by the man who brought you the beginning of the story, Paul (Origin) Jenkins!&quot; Art is by Claudio Castellini. This Digital copy is by Minutemen-PhD. Thanks to them for their work, please seed and enjoy!
